コロンビア PM5427 ロッカウェイデンスフーディーが入荷！「ターボダウン」と「オムニヒート」のダブル仕様で温かさを逃がさないダウンジャケット。立体裁断で作られた動きを妨げない着心地もポイント。雨や汚れを効果的に弾く撥水テクノロジー「オムニシールド」のおかげで、急な天候の変化にも安心です。携帯に便利なスタッフバッグ付き。シンプルなデザインで、アウトドアでもタウンでもおしゃれに着こなせます。素材：表（無地、プリント）,デンスリップストップ（ナイロン100%）表（ヘザー）,デンスヘザー（ナイロン80%、ポリエステル20%）裏,ライトニングウィズリフレクティブプリント中わた,650FPダウン（ダウン80%、フェザー20%）,オムニヒートインシュレーション60g,（リサイクルポリエステル50%、ポリエステル50%）



