コロンビア PM3663 アーチャーリッジジャケットが入荷！防風テクノロジー「オムニウィンドブロック」のフリースジャケット。表起毛のもこもこした感じが人気の定番アイテムです。起毛しｔ生地と中綿で保温効果を高め、オムニウィンドブロックが風を防ぎ、ウェア内の蒸れを外へ逃がします。肩の立体裁断により腕の動きも妨げません。アウトドアシーンでは温かく、タウンではファッションのポイントに。秋冬シーズンに1枚あると便利な1枚です。
■素材：表,アーチャーフリース3L（ポリエステル100%）切り替え,ビエントプレインウイーブ（ポリエステル100%）中わた,マイクロテンプ（ポリエステル100%）



