columbia コロンビア WE1190 バガブー1986 インターチェンジジャケットが入荷！どこか懐かしくノスタルジックな雰囲気の80～90年代のデザインを落とし込んだ復刻版ライナー付きインターチェンジジャケットです。インパクト大のビビットなカラーリングが魅力。表地は防水透湿機能オムニテック素材により雪や雨から身体を守りながら、不快なムレは外に逃がしウェア内を快適に保ちます。ポケット内側にはスマートフォンなどを収納出来るエキストラポケット付き。機能性、ファッション性に優れた一枚は冬のアウトドアシーンではもちろん、タウンユースでも存在感抜群で気分を盛り上げてくれること間違いなしのアイテムです。
■素材：表,ナイロン100%裏,ポリエステル100%ライナー,ポリエステル100% 

