Columbia「コロンビア」から２０１６秋冬新作！PM3678 VIZZAVONA PASS JACKET「ヴィザヴォナ パス ジャケット」が入荷！コロンビアが独自に開発したアウトドアフィールドで必須のプロテクション機能「オムニシールド」により、雨などの水分の侵入をシャットアウト。素材そのものの風合いを残したナイロン素材で着用のシーンを選びません。肩は立体裁断、アンダーアームと肘部分にマチを設けて、行動時も快適な着心地を実現。アウトドアからタウンユースまで幅広く活躍します。■素材：ナイロン、ポリエステル




