Columbia「コロンビア」から２０１６秋冬新作 PM3709 BARTON PASS JACKET 「バートン パス ジャケット」が入荷！水分や汚れからファブリックを守るオムニシールド加工を施されたごく一部の限られた店舗でリリースされている別注モデルのジャケット。個性溢れるネイティブ柄をあしらった生地はインパクトバツグン。フードから首周りまで配されたドローコードを備え、引っ張る事で外周を狭める事が出来ます。中央のＷジッパーは顔の下うえくらいまで上げられるよう、計算された作り＆肩と袖の立体裁断により細身のシルエットながら動きやすく、左右と胸部にジッパーポケット付きです。 素材：表地：ポリエステル１００％　裏地：ポリエステル１００％　フード裏地と裏地裾部分：ナイロン１００％



